jobs.description:
L’Azienda DISSEGNA LOGISTICS, leader nel settore dei trasporti, è alla ricerca di:
AUTOTRASPORTATORE

Guida il tuo futuro di domani, Scegli Dissegna Logistics oggi!
Siamo oltre 370 volti, persone. Un gruppo di professionisti che spaziano da logística a pianificazione e controllo. Alla guida o in ufficio per noi ogni giorno è un viaggio, unisciti al nostro team.

Patente CE;
Carta di qualificazione del conducente (CQC - CPC - CPP);
Passaporto in corso di validità;
Buona conoscenza della lingua italiana;
Esperienza pregressa di almeno un anno;
Conoscenza basenell'utilizzo di app mobile;
• *La mansione**:
L'impiego è previsto sia in ambito intermodale sia nel trasporto a temperatura controllata.
Preferibile residenza nei pressi degli interporti di Venezia, Padova, Verona, Milano.
• *Cosa offriamo**:
Per la presente posizione è prevista una remunerazione conforme al CCNL autotrasporto merci e logística industria e welfare aziendale
